import React from 'react';
import './Header.scss';
import logoPath from '../../assets/logos/Logo-brainflix.svg';
import navImage from '../../assets/images/Mohan-muruge.jpg';

export default function Header () {
    return (
    <header className="header">
        <div className="header__nav header__nav--left">
            <img className="header__logo" src={logoPath} alt="brainflix logo"/>
        </div>
        <div className="header__nav header__nav--right">
          <input className="header__nav-search" placeholder="Search..." />
          <button className="header__nav-button">Upload</button>
          <img src={navImage} alt="nav image" />
        </div>
    </header>
    );
}
